import React from 'react';
import './AdjacencyList.css';

const AdjacencyList = ({ adjacencyList }) => {
  if (!adjacencyList || typeof adjacencyList !== 'object') {
    return <p>Список суміжності недоступний</p>;
  }

  return (
    <div>
      <h3>Список Суміжності</h3>
      <ul>
        {Object.entries(adjacencyList).map(([key, neighbors]) => (
          <li key={key}>
            {key}: {neighbors && neighbors.length > 0 ? neighbors.join(', ') : 'немає'}
          </li>
        ))}
      </ul>
    </div>
  );
};

export default AdjacencyList;
